void* sum(const void * const ptr, int size){
    if(ptr==NULL || size<=0){
        return NULL;
    }
    int offset=0;
    double * sum_ptr= (double *) malloc(sizeof(double ));
    if(sum_ptr==NULL){
        return NULL;
    }
    *sum_ptr=0;
    for(int i=0;i<size;i++){
        uint8_t first = *((uint8_t*)ptr+offset);
        offset+=1;
        int amount = first%16;
        first/=16;
        int type = first;
        for(int j=0;j<amount;j++) {
            switch (type) {
                case 0:
                    *sum_ptr += (double) (*(char *)((uint8_t*)ptr + offset));
                    offset += 1;
                    break;
                case 1:
                    *sum_ptr += (double) (*(unsigned char *) ((uint8_t*)ptr + offset));
                    offset += 1;
                    break;
                case 2:
                    *sum_ptr += (double) (*(int32_t *) ((uint8_t *) ptr + offset));
                    offset += 4;
                    break;
                case 3:
                    *sum_ptr += (double) (*(uint32_t *) ((uint8_t *) ptr + offset));
                    offset += 4;
                    break;
                case 4:
                    *sum_ptr += (double) (*(float *) ((uint8_t*)ptr + offset));
                    offset += 4;
                    break;
                case 5:
                    *sum_ptr += (*(double *) ((uint8_t*)ptr + offset));
                    offset += 8;
                    break;
            }
            //printf("%lf\n",*sum_ptr);
        }
    }
    return sum_ptr;
}